import React,{useState} from "react";
import axios from "axios";

export default function AddTeacher(){

const[name, setName] = useState("");
const[age, setAge] = useState("");
const[gender, setGender] = useState("");
const[phoneNumber, setPhone] = useState("");
const[email, setEmail] = useState("");
const[password, setPassword] = useState("");
const[description, setDescription] = useState("");

function sendData(e){
  e.preventDefault();
  
  const newTeacher ={
    name,
    age,
    gender,
    phoneNumber,
    email,
    password,
    description

  }

  axios.post("http://localhost:8070/teacher/add",newTeacher).then(()=>{
    alert("Teacher Added")
    setName("");
    setAge("");
    setGender("");
    setPhone("");
    setEmail("");
    setPassword("");
    setDescription("");
    
  }).catch((err)=>{
    alert(err)
  })
 
}


return(

<div className="container">

    <h1><center>Add Teacher.</center></h1>

<form onSubmit={sendData}>
 
 <div class="mb-3">
    <label for="name" class="form-label">Name</label>
    <input type="text" class="form-control" id="name" placeholder="Enter your name"
    onChange={(e)=>{

      setName(e.target.value);
   }}
  
    /> 
   
  </div>

<div class="mb-3">
    <label for="age" class="form-label">Age</label>
    <input type="text" class="form-control" id="age" placeholder="Enter your age"
    onChange={(e)=>{

      setAge(e.target.value);
    }}
    
    /> 
  </div>

<div class="mb-3">
    <label for="gender" class="form-label">Gender</label>
    <input type="text" class="form-control" id="gender" placeholder="Enter your gender"
     onChange={(e)=>{

      setGender(e.target.value);
    }}

    /> 
   </div>

<div class="mb-3">
    <label for="exampleInputEmail1" class="form-label">Phone Number</label>
    <input type="phone" class="form-control" id="phone" placeholder="Enter your phone number"
     onChange={(e)=>{

      setPhone(e.target.value);
    }}
    
    /> 
    <div id="emailHelp" class="form-text">Must be 10 numbers long. </div>
  </div>


 <div class="mb-3">
    <label for="exampleInputEmail1" class="form-label">Email address</label>
    <input type="email" class="form-control" id="mail" placeholder="name@example.com"
     onChange={(e)=>{

      setEmail(e.target.value);
    }}

    /> 
    <div id="emailHelp" class="form-text">We'll never share your email with anyone else.</div>
  </div>

  <label for="inputPassword5" class="form-label">Password</label>
  <input type="password" id="psw" class="form-control" aria-describedby="passwordHelpBlock" pattern ="(?=.*\d)(?=.*[a-z])(?=.*[A-Z]).{8,}" title="Must contain at least one number and one uppercase and lowercase letter, and at least 8 or more characters" required
   onChange={(e)=>{

    setPassword(e.target.value);
  }}

  />
  <div id="passwordHelpBlock" class="form-text">
  Your password must be 8-20 characters long, contain letters and numbers, and must not contain spaces, special characters, or emoji.
   </div>

  <div class="mb-3">
  <label for="exampleFormControlTextarea1" class="form-label">Description</label>
  <textarea class="form-control" id="exampleFormControlTextarea1" rows="5"placeholder="Enter your other information" 
  onChange={(e)=>{

    setDescription(e.target.value);
  }}
  >

  </textarea>
   </div>

  <button type="submit" class="btn btn-primary">Save</button>
</form>
</div>

)
}
